CREATE TABLE files_system (
  ID SERIAL PRIMARY KEY,
  TYPE text,
  NAME text,
  PARENT_FOLDER int(20),
  PUBLISH_URI text,
  CLASSIFY text,
  CREATE_TIME text
);

CREATE SEQUENCE files_id_seq  
START WITH 35  
INCREMENT BY 1  
NO MINVALUE  
NO MAXVALUE  
CACHE 1;  
  
alter table files_system alter column ID set default nextval('files_id_seq');

