CREATE TABLE sites_construction (
  ID SERIAL PRIMARY KEY,
  NAME text,
  KEY_NAME text,
  CONTENT text,
  CONTENT_ORIGIN text,
  CLASSIFY text,
  CREATE_TIME text,
  PARENT_FOLDER int
);

CREATE SEQUENCE site_id_seq  
START WITH 15
INCREMENT BY 1  
NO MINVALUE  
NO MAXVALUE  
CACHE 1;  
  
alter table sites_construction alter column ID set default nextval('files_id_seq');


